import React from "react";

const api = "e40f650c2214e7883b9a3e4cd28fb910";
const testCity = "Paris";

export const search = (a) => {
  fetch(
    `http://api.weatherstack.com/current?access_key=${api}&query=${testCity}`
  )
    .then((response) => response.json())
    .then((data) => {
      console.log(data);
      console.log(a)
    });
};
